sap.ui.define([
    "sap/ui/core/mvc/Controller",
],
    /**
     * @param {typeof sap.ui.core.mvc.Controller} Controller
     */
    function (Controller, PDFLib) {//
        "use strict";

        return Controller.extend("vapdf.controller.Main", {
            onInit: function () {

            },
            onCreatePDF: function () {
                var imgData = 'data:image/jpeg;base64,'
                var doc = new jsPDF()


                doc.addImage(imgData, 'JPEG', 0, 0, 210, 290)

                doc.setFontSize(10)
                doc.text(40, 40, 'Love Love')

                doc.save("SamplePDF.pdf");
            }
        });
    });
